import React, { Fragment, useEffect, useState } from "react";
import axios from "axios";

const Search = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get("http://dummy.restapiexample.com/api/v1/employees")
      .then(res => {
        console.log(res);
        setData(res.data.data);
      })
      .catch(err => {
        console.log(err);
      });
  }, []);
  return (
    <Fragment>
      <section className="main">
        <form name="login" method="POST" className="search-form">
          <input
            type="text"
            placeholder="Search"
            name="username"
            id="username"
            required
            autoComplete="off"
          />
          {/* <div className="button-submit">
            <button type="submit" id="loginButton">
              Search
            </button>
          </div> */}
        </form>
        <div className="table-search">
          <table>
            <tbody>
              <tr>
                <th>Emplyoee Id</th>
                <th>Emplyoee Name</th>
                <th>Emplyoee Salary</th>
                <th>Emplyoee Age</th>
              </tr>
            </tbody>
            <tbody>
              {data.map(data => (
                <tr key={data.id}>
                  <td>{data.id}</td>
                  <td>{data.employee_name}</td>
                  <td>{data.employee_salary}</td>

                  <td>
                    <button>delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>
    </Fragment>
  );
};

export default Search;
